configure:
  commands:
    no ip nat inside source static 35.0.0.1 135.0.0.1 route-map rm1:
      new_state: confirm_operation
    end:
      new_state: execute
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Stargazer(config)#
confirm_operation:
  prompt: "no ip nat inside\
      \ source static 35.0.0.1 135.0.0.1 route-map rm1\r\n\r\nStatic entry in use,\
      \ do you want to delete child entries? [no]: "
  commands:
    "yes":
      new_state: configure
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Stargazer(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Stargazer#
